import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from './components/Home';
import Navbar from './components/Navbar';
import TaskState from './context/TaskState';

function App() {
  return (
    <TaskState>
      <Router>
        <Navbar />
        <div className="App">
          <Switch>
            <Route ex>
              <Home />
            </Route>
          </Switch>
        </div>
      </Router>
    </TaskState>
  );
}

export default App;
